import { useEffect, useState } from "react";
import { Table, Pagination } from "react-bootstrap";
import axios from "axios";

export default function Paginationdata() {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    getdata();
  }, []);

  function getdata() {
    // const url = "https://api.instantwebtools.net/v1/airlines";
    // const url = "http://45.90.108.154/users";
    const url = "https://jsonplaceholder.typicode.com/posts";
    axios.get(url).then((res) => {
      console.log(res.data);
      setUserData(res.data);
    });
  }

  return (
    <>
      <div className=" container  table-responsive-lg mt-5 pt-1 pb-5 table  table-responsive-sm  table-responsive-md">
        <Table bordered striped hover>
          <thead>
            <tr>
              <th>id</th>
              <th> Name</th>
              <th> phone</th>
            </tr>
          </thead>
          <tbody>
            {userData.slice(0, 30).map((curElm, id) => {
              return (
                <tr key={curElm.id}>
                  <td> {curElm.id} </td>
                  <td> {curElm.body} </td>
                  <td> {curElm.title} </td>
                </tr>
              );
            })}
          </tbody>
        </Table>
        <Pagination></Pagination>
      </div>
    </>
  );
}
